import { Box, Typography } from '@mui/material';

function PersonalInformation() {
  return (
    <Box sx={{ backgroundColor: '#fff', padding: '10px' }}>
      <Box sx={{ display: 'flex' }}>
        <Typography
          variant="h5"
          gutterBottom
          sx={{
            fontFamily: 'SVN-Sofia-Medium',
            fontWeight: 500,
            fontSize: '20px',
            margin: 0,
            justifyContent: 'space-between',
            alignItems: 'center',
          }}
        >
          Personal Information
        </Typography>
        <Typography
          variant="body2"
          gutterBottom
          sx={{ fontFamily: 'SVN-Sofia-Medium', color: 'rgb(104, 112, 118)', display: 'flex' }}
        >
          Required &nbsp;(
          <Typography variant="body1" gutterBottom sx={{ fontSize: '16px', color: 'rgb(229, 72, 77)' }}>
            *
          </Typography>
          )
        </Typography>
      </Box>
    </Box>
  );
}

export default PersonalInformation;
